import React from 'react';
import './styles.css';

const Records = () => (
    <div className="page-container">
        <table className="records-table" cellPadding="0" cellSpacing="0">
            <thead>
                <tr>
                    <th>NOME</th>
                    <th>INSTANTE</th>
                    <th>IDADE</th>
                    <th>PLATAFORMA</th>
                    <th>GÉNERO</th>
                    <th>TÍTULO DO GAME</th>
                </tr>
            </thead>
        </table>
    </div>
);

export default Records;
